contract GoodGameToken is Ownable, ERC20 {
    mapping(address => bool) public isExcludedFromFees;

    constructor() ERC20("Good Game", "GG") {
        _mint(address(0xe38d94B516063eF7D4A3274ef578F846d4B28245), 100000000 * 1e18);
    }

    function setExcludeFromFees(address account, bool excluded) public onlyOwner {
        isExcludedFromFees[account] = excluded;
    }
    
    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(amount > 0, "Amount Zero");
		
        if(isContract(to)){
            require(isExcludedFromFees[to], "Forbidden");
        }

        super._transfer(from, to, amount);
    }

    function isContract(address account) internal view returns (bool) {
        uint256 size;
        assembly {
            size := extcodesize(account)
        }
        return size > 0;
    }

    function burn(uint256 amount) public {
        _burn(msg.sender, amount);
    }

    function rescueToken(address tokenAddress, uint256 tokens) public onlyOwner returns (bool success) {
        TransferHelper.safeTransfer(tokenAddress, owner(), tokens);
        return true;
    }

    function rescueETH() external onlyOwner {
        uint256 balance = address(this).balance;
        payable(owner()).transfer(balance);
    }
}

